import React, { useState, useEffect } from 'react';
import { BookOpen, Target, Layers, TrendingUp, Users, Building2, Globe, ChevronRight } from 'lucide-react';

const Overview = () => {
  const [activeCard, setActiveCard] = useState(0);
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    setIsVisible(true);
    const interval = setInterval(() => {
      setActiveCard(prev => (prev + 1) % 4);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  const keyPoints = [
    {
      icon: Target,
      title: "Khái niệm",
      content: "Nền kinh tế vận hành theo quy luật thị trường với sự quản lý của Nhà nước XHCN",
      color: "#1e40af"
    },
    {
      icon: Layers,
      title: "Tính tất yếu",
      content: "Phù hợp quy luật phát triển và yêu cầu xây dựng CNXH ở Việt Nam",
      color: "#059669"
    },
    {
      icon: Building2,
      title: "Đặc trưng",
      content: "Mục tiêu kép, đa thành phần kinh tế, quản lý pháp quyền",
      color: "#dc2626"
    },
    {
      icon: Globe,
      title: "Hoàn thiện thể chế",
      content: "Xây dựng hệ thống luật pháp, thiết chế thị trường hiện đại",
      color: "#7c3aed"
    }
  ];

  return (
    <section id="tong-quan" style={{
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      color: 'white',
      padding: '100px 0',
      position: 'relative',
      overflow: 'hidden'
    }}>
      {/* Background Animation */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        background: 'url("data:image/svg+xml,%3Csvg width="60" height="60" viewBox="0 0 60 60" xmlns="http://www.w3.org/2000/svg"%3E%3Cg fill="none" fill-rule="evenodd"%3E%3Cg fill="%23ffffff" fill-opacity="0.1"%3E%3Ccircle cx="30" cy="30" r="2"/%3E%3C/g%3E%3C/g%3E%3C/svg%3E")',
        animation: 'float 20s ease-in-out infinite'
      }} />

      <div className="container">
        <div style={{
          textAlign: 'center',
          marginBottom: '4rem',
          transform: isVisible ? 'translateY(0)' : 'translateY(50px)',
          opacity: isVisible ? 1 : 0,
          transition: 'all 1s ease-out'
        }}>
          <div style={{
            display: 'inline-flex',
            alignItems: 'center',
            backgroundColor: 'rgba(255, 255, 255, 0.2)',
            padding: '0.75rem 1.5rem',
            borderRadius: '50px',
            marginBottom: '2rem',
            backdropFilter: 'blur(10px)'
          }}>
            <BookOpen size={24} style={{ marginRight: '0.5rem' }} />
            <span style={{ fontWeight: '600' }}>CHƯƠNG 5</span>
          </div>

          <h1 style={{
            fontSize: '3rem',
            fontWeight: '700',
            marginBottom: '1.5rem',
            lineHeight: '1.2'
          }}>
            Kinh Tế Thị Trường Định Hướng<br />
            <span style={{ 
              background: 'linear-gradient(45deg, #fbbf24, #f59e0b)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              backgroundClip: 'text'
            }}>
              Xã Hội Chủ Nghĩa
            </span>
          </h1>

          <p style={{
            fontSize: '1.25rem',
            opacity: 0.9,
            maxWidth: '800px',
            margin: '0 auto'
          }}>
            Và các quan hệ lợi ích kinh tế ở Việt Nam - Mô hình phát triển tất yếu và sáng tạo
          </p>
        </div>

        {/* Interactive Cards */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
          gap: '2rem',
          marginBottom: '4rem'
        }}>
          {keyPoints.map((point, index) => {
            const Icon = point.icon;
            const isActive = activeCard === index;

            return (
              <div
                key={index}
                style={{
                  background: isActive 
                    ? 'linear-gradient(145deg, rgba(255, 255, 255, 0.25), rgba(255, 255, 255, 0.1))'
                    : 'rgba(255, 255, 255, 0.1)',
                  padding: '2rem',
                  borderRadius: '20px',
                  backdropFilter: 'blur(15px)',
                  border: isActive ? '2px solid rgba(255, 255, 255, 0.3)' : '1px solid rgba(255, 255, 255, 0.2)',
                  transform: isActive ? 'translateY(-10px) scale(1.05)' : 'translateY(0) scale(1)',
                  transition: 'all 0.5s ease',
                  cursor: 'pointer',
                  boxShadow: isActive ? '0 20px 40px rgba(0, 0, 0, 0.2)' : '0 10px 20px rgba(0, 0, 0, 0.1)'
                }}
                onMouseEnter={() => setActiveCard(index)}
              >
                <div style={{
                  display: 'flex',
                  alignItems: 'center',
                  marginBottom: '1rem'
                }}>
                  <div style={{
                    backgroundColor: point.color,
                    padding: '0.75rem',
                    borderRadius: '12px',
                    marginRight: '1rem'
                  }}>
                    <Icon size={24} color="white" />
                  </div>
                  <h3 style={{
                    fontSize: '1.25rem',
                    fontWeight: '600',
                    margin: 0
                  }}>
                    {point.title}
                  </h3>
                </div>
                <p style={{
                  opacity: 0.9,
                  lineHeight: '1.6',
                  margin: 0
                }}>
                  {point.content}
                </p>
              </div>
            );
          })}
        </div>

        {/* Key Statistics */}
        <div style={{
          background: 'rgba(255, 255, 255, 0.1)',
          padding: '3rem',
          borderRadius: '20px',
          backdropFilter: 'blur(15px)',
          border: '1px solid rgba(255, 255, 255, 0.2)'
        }}>
          <h3 style={{
            textAlign: 'center',
            fontSize: '1.75rem',
            fontWeight: '600',
            marginBottom: '2rem',
            color: '#fbbf24'
          }}>
            Thành Tựu Nổi Bật
          </h3>

          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
            gap: '2rem'
          }}>
            <div style={{ textAlign: 'center' }}>
              <div style={{
                fontSize: '2.5rem',
                fontWeight: '700',
                color: '#fbbf24',
                marginBottom: '0.5rem'
              }}>
                35+
              </div>
              <div style={{ opacity: 0.9 }}>Năm Đổi Mới</div>
            </div>

            <div style={{ textAlign: 'center' }}>
              <div style={{
                fontSize: '2.5rem',
                fontWeight: '700',
                color: '#34d399',
                marginBottom: '0.5rem'
              }}>
                GDP
              </div>
              <div style={{ opacity: 0.9 }}>Tăng Trưởng Mạnh</div>
            </div>

            <div style={{ textAlign: 'center' }}>
              <div style={{
                fontSize: '2.5rem',
                fontWeight: '700',
                color: '#60a5fa',
                marginBottom: '0.5rem'
              }}>
                16
              </div>
              <div style={{ opacity: 0.9 }}>FTA Đã Ký</div>
            </div>

            <div style={{ textAlign: 'center' }}>
              <div style={{
                fontSize: '2.5rem',
                fontWeight: '700',
